window.bookSummaryJSON = "<p><b>You are mine.</b></p> <p>Michael Byron Domenico Sovrano. </p> <p>Lord of the underworld.</p> <p>Master of all the criminal masterminds who ever crawled the underbelly of Sicily's notorious mafia company.</p> <p>Who just happens to be hot and snarly, and with a demanding manner, gulp!</p> <p>My father owed him, so he took me as payment. He gets what he wants, and I am his new obsession. To take. To break. As if I'll let him.</p> <p>He's out to destroy me, but I'll go toe-to-toe with him every step of the way. I'll do everything to make him fall for me. </p> <p>Until he springs the ultimate surprise.</p> <p>Note: This is book one in Michael Byron and Karma's story. A dark billionaire arranged-marriage mafia romance with intense emotional scenes.</p>"; 
